	public static int lengthOfLongestSubstring(String source) {
		if(source == null) {
			return 0;
		}

		int i = 0, j = 0, maxLength = 0, len = source.length();
		Set<Character> set = new HashSet<>();
		
		while(i < len && j < len) {
			if(!set.contains(source.charAt(j))) {
				set.add(source.charAt(j++));
				maxLength = Math.max(maxLength, j - i);//set.size()
			}else {
				set.remove(source.charAt(i++));
			}
		}
		
		return maxLength;
	}
